import React, { useState } from 'react';
import AppBar from '@mui/material/AppBar';
import Toolbar from '@mui/material/Toolbar';
import Typography from '@mui/material/Typography';
import Button from '@mui/material/Button';
import Box from '@mui/material/Box';
import IconButton from '@mui/material/IconButton';
import MenuIcon from '@mui/icons-material/Menu';
import Drawer from '@mui/material/Drawer';
import List from '@mui/material/List';
import ListItem from '@mui/material/ListItem';
import ListItemButton from '@mui/material/ListItemButton';
import ListItemText from '@mui/material/ListItemText';
import InputBase from '@mui/material/InputBase';
import SearchIcon from '@mui/icons-material/Search';
import ExploreIcon from '@mui/icons-material/Explore';
import { Link, useLocation } from 'react-router-dom';

const navLinks = [
  { label: 'Home', to: '/' },
  { label: 'Planner', to: '/planner' },
  { label: 'Login', to: '/login' },
  { label: 'Signup', to: '/signup' },
];

function Navbar() {
  const [drawerOpen, setDrawerOpen] = useState(false);
  const [search, setSearch] = useState('');
  const location = useLocation();
  const [elevate, setElevate] = useState(false);
  React.useEffect(() => {
    const onScroll = () => setElevate(window.scrollY > 10);
    window.addEventListener('scroll', onScroll);
    return () => window.removeEventListener('scroll', onScroll);
  }, []);

  return (
    <AppBar
      position="sticky"
      color="transparent"
      elevation={elevate ? 6 : 2}
      sx={{
        zIndex: 1201,
        transition: 'box-shadow 0.3s',
        background: 'rgba(255,255,255,0.95)',
        boxShadow: '0 2px 10px rgba(0,0,0,0.10)',
        backdropFilter: 'blur(8px)',
      }}
    >
      <Toolbar sx={{ minHeight: 72, px: { xs: 2, md: 6 } }}>
        {/* Logo & Branding */}
        <Box
          component={Link}
          to="/"
          sx={{
            mr: 3,
            display: 'flex',
            alignItems: 'center',
            textDecoration: 'none',
            py: 1.5,
            px: 3,
            borderRadius: 3,
            background: 'none',
          }}
        >
          <ExploreIcon sx={{ color: '#FF6B35', fontSize: 36, mr: 1, mb: 0.5, transition: 'transform 0.2s', '&:hover': { transform: 'rotate(-15deg) scale(1.1)' } }} />
          <Typography
            variant="h4"
            sx={{
              fontFamily: 'Poppins, Arial, sans-serif',
              fontWeight: 700,
              fontSize: 28,
              color: 'primary.main',
              letterSpacing: '-1px',
              textShadow: '0 2px 8px rgba(255,107,53,0.08)',
              ml: 0.5,
              textDecoration: 'none',
            }}
          >
            Indian Offbeat Travel Guide
          </Typography>
        </Box>
        {/* Navigation Links */}
        <Box sx={{ display: { xs: 'none', md: 'flex' }, alignItems: 'center', ml: 'auto', gap: 4 }}>
          {navLinks.map(link => {
            const isActive = location.pathname === link.to;
            return (
              <Button
                key={link.to}
                component={Link}
                to={link.to}
                sx={{
                  fontFamily: 'Poppins, Arial, sans-serif',
                  fontWeight: 500,
                  fontSize: 16,
                  color: isActive ? 'primary.main' : '#2C3E50',
                  px: 0,
                  position: 'relative',
                  background: 'none',
                  minWidth: 0,
                  mx: 2,
                  transition: 'color 0.3s',
                  '&:hover': {
                    color: '#FF6B35',
                    background: 'none',
                  },
                  '&:after': {
                    content: '""',
                    display: 'block',
                    position: 'absolute',
                    left: 0,
                    bottom: -4,
                    width: isActive ? '100%' : '0%',
                    height: 3,
                    background: '#FF6B35',
                    borderRadius: 2,
                    transition: 'width 0.3s',
                  },
                  '&:hover:after': {
                    width: '100%',
                  },
                }}
              >
                {link.label}
              </Button>
            );
          })}
        </Box>
        {/* Search Bar */}
        <Box sx={{ display: { xs: 'none', md: 'flex' }, alignItems: 'center', ml: 4, background: '#f2f2f2', borderRadius: 2, px: 1 }}>
          <SearchIcon color="primary" />
          <InputBase
            placeholder="Search destinations..."
            value={search}
            onChange={e => setSearch(e.target.value)}
            sx={{ ml: 1, flex: 1, minWidth: 120, fontFamily: 'Inter, Arial, sans-serif' }}
            inputProps={{ 'aria-label': 'search destinations' }}
          />
        </Box>
        {/* Mobile Hamburger */}
        <Box sx={{ display: { xs: 'flex', md: 'none' }, ml: 'auto' }}>
          <IconButton onClick={() => setDrawerOpen(true)}>
            <MenuIcon />
          </IconButton>
        </Box>
        <Drawer anchor="right" open={drawerOpen} onClose={() => setDrawerOpen(false)}>
          <Box sx={{ width: 220, pt: 2 }}>
            <List>
              {navLinks.map(link => (
                <ListItem key={link.to} disablePadding>
                  <ListItemButton component={Link} to={link.to} onClick={() => setDrawerOpen(false)} selected={location.pathname === link.to}>
                    <ListItemText primary={link.label} />
                  </ListItemButton>
                </ListItem>
              ))}
            </List>
            <Box sx={{ display: 'flex', alignItems: 'center', px: 2, mt: 2, background: '#f2f2f2', borderRadius: 2 }}>
              <SearchIcon color="primary" />
              <InputBase
                placeholder="Search..."
                value={search}
                onChange={e => setSearch(e.target.value)}
                sx={{ ml: 1, flex: 1, minWidth: 80, fontFamily: 'Inter, Arial, sans-serif' }}
                inputProps={{ 'aria-label': 'search destinations' }}
              />
            </Box>
          </Box>
        </Drawer>
      </Toolbar>
    </AppBar>
  );
}

export default Navbar;
